import ServiceCard from '../components/ServiceCard';
import TestimonialCard from '../components/TestimonialCard';
import StepCard from '../components/StepCard';

const services = [
  {
    title: 'Modular Kitchen',
    description: 'Custom kitchen designs that blend style and functionality.',
    color: 'bg-blue-100',
    iconColor: 'text-blue-600',
    icon: (
      <svg className="w-8 h-8" fill="none" stroke="currentColor" strokeWidth="2" viewBox="0 0 24 24"><path d="M4 6h16M4 12h16M4 18h16" /></svg>
    ),
  },
  {
    title: 'False Ceiling',
    description: 'Elegant ceiling solutions for a modern look and feel.',
    color: 'bg-pink-100',
    iconColor: 'text-pink-600',
    icon: (
      <svg className="w-8 h-8" fill="none" stroke="currentColor" strokeWidth="2" viewBox="0 0 24 24"><circle cx="12" cy="12" r="10" /></svg>
    ),
  },
  {
    title: 'Wardrobes',
    description: 'Spacious and stylish wardrobes tailored to your needs.',
    color: 'bg-green-100',
    iconColor: 'text-green-600',
    icon: (
      <svg className="w-8 h-8" fill="none" stroke="currentColor" strokeWidth="2" viewBox="0 0 24 24"><rect x="4" y="4" width="16" height="16" rx="2" /></svg>
    ),
  },
];

const testimonials = [
  {
    name: 'Priya & Arjun S',
    location: 'Hyderabad',
    text: 'Thrilled with the transformation of our home! The design team really listened to our needs and turned our 2 BHK into a stylish, functional space. Every detail was handled with care, highly recommended!',
  },
  {
    name: 'Ravi M.',
    location: 'Startup Founder',
    text: 'Professional, creative, and always on time. They designed our office interiors exactly how we imagined — modern, bright, and practical. Our clients and staff love the new space!',
  },
  {
    name: 'Mr. & Mrs. Kumar',
    location: 'Villa Owners',
    text: 'Smooth experience from start to finish. From the first consultation to the final handover, the team was responsive and transparent. The modular kitchen and wardrobes look fantastic and are very practical.',
  },
];

const steps = [
  {
    title: 'Concept & Consultation',
    description: 'We begin with a detailed consultation to understand your vision, lifestyle, space requirements, and budget.',
  },
  {
    title: 'Design & Planning',
    description: 'Our designers create a detailed plan, including layout drawings, 3D visualizations, and material selection.',
  },
  {
    title: 'Execution & Development',
    description: 'Our project team brings the design to life, managing everything from civil work to décor installation.',
  },
  {
    title: 'Final Handover & Support',
    description: 'We do a thorough quality check and provide post-completion support to ensure your satisfaction.',
  },
];

function Home() {
  return (
    <div>
      {/* Hero Section */}
      <section className="bg-gradient-to-r from-blue-100 to-pink-100 py-20 text-center">
        <h1 className="text-5xl font-bold mb-4">Transforming Spaces, Inspiring Lives</h1>
        <p className="mb-8 text-lg max-w-xl mx-auto">Modern interior and construction solutions for homes and offices. Let us bring your vision to life!</p>
        <a href="/contact" className="btn-main">Get a Quote</a>
      </section>

      {/* Services Summary */}
      <section className="py-16 bg-gray-50">
        <h2 className="text-3xl font-bold text-center mb-10">Our Services</h2>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-8 max-w-5xl mx-auto">
          {services.map((service, i) => (
            <ServiceCard key={i} {...service} />
          ))}
        </div>
        <div className="text-center mt-10">
          <a href="/services" className="btn-main">View All Services</a>
        </div>
      </section>

      {/* How We Work Section */}
      <section className="py-16 bg-blue-50">
        <h2 className="text-3xl font-bold text-center mb-10">How We Work</h2>
        <div className="grid grid-cols-1 md:grid-cols-4 gap-8 max-w-5xl mx-auto">
          {steps.map((step, i) => (
            <StepCard key={i} step={i + 1} {...step} />
          ))}
        </div>
      </section>

      {/* Testimonials Section */}
      <section className="py-16 bg-white">
        <h2 className="text-3xl font-bold text-center mb-10">What Our Clients Say</h2>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-8 max-w-5xl mx-auto">
          {testimonials.map((t, i) => (
            <TestimonialCard key={i} {...t} />
          ))}
        </div>
      </section>
    </div>
  );
}

export default Home;
